    function test_order_together_delivery()
    {
        $saleLogic = new SellerOrderLogic();
        $orderId = 2041109071;
        $userinfoId = 22;
        $saleInfo = \App\Facades\Sale\Sale::getSale(2041109071, null);
        $salesDeliveryTogether = $saleLogic->orderDeliveryTogether($saleInfo, 1200);
        $eq = DataCompare::getInstance()->handle('gray_order_delivery', function () use ($salesDeliveryTogether) {
            $oldList = collect($salesDeliveryTogether)->map(function ($item) {
                $item["orderId"] = $item["id"];
                $item["md5"] = $item["addrMd5"];
                unset($item["id"], $item["uri"], $item["addrMd5"], $item["status"]);
                return $item;
            })->toArray();
            var_dump($oldList);
            return $oldList;
        }, function () use ($orderId, $userinfoId) {
            $data = $this->bus->order()->delivery->getOrderTogetherDelivery($orderId, $userinfoId);
            if ($data["code"] == 0) {
                $newList = [];
                foreach ((array)$data["data"] as $key => $val) {
                    $newList[$val["orderId"]] = $val;
                    unset($newList[$val["orderId"]]["isTogether"]);
                }
            }
            var_dump($newList);
            return (array)$newList;
        });
        $this->assertTrue($eq);
        // dd($newList);
    }


    function test_list_order_together_delivery()
    {
        $saleLogic = new SellerOrderLogic();
        $orderId = [2041109071, 2041109073];
        $userinfoId = 22;
        $data = Bus::order()->delivery->batchOrderTogetherDelivery($orderId, $userinfoId);
        $newList = [];
        if ($data["code"] == 0) {
            $list = $data["data"];
            $collection = collect($list)->groupBy(function ($item) {
                return $item["md5"] . $item["winUserinfoId"];
            })->toArray();
            foreach ((array)$list as $value) {
                $newList[$value["orderId"]] = count($collection[$value["md5"] . $value["winUserinfoId"]]);
            }
        }
        dd($newList);
        $saleList = \App\Facades\Sale\Sale::getSale($orderId, null);
        //批量取订单信息
        $orderArr = $saleLogic->batchOrderDeliveryTogether($saleList, 1200);
        //var_dump($orderArr);
        $eq = DataCompare::getInstance()->handle('gray_order_delivery', function () use ($orderArr) {
            $oldList = [];
            foreach ((array)$orderArr as $k => $val) {
                $oldList[$k] = count($orderArr[$k]);
            }
            //var_dump($oldList);
            return $oldList;
        }, function () use ($orderId, $userinfoId) {
            $data = Bus::order()->delivery->batchOrderTogetherDelivery($orderId, $userinfoId);
            $newList = [];
            if ($data["code"] == 0) {
                $list = $data["data"];
                $collection = collect($list)->groupBy(function ($item) {
                    return $item["md5"] . $item["winUserinfoId"];
                })->toArray();
                foreach ((array)$list as $value) {
                    $newList[$value["orderId"]] = count($collection[$value["md5"] . $value["winUserinfoId"]]);
                }
            }
            return $newList;
        });
        $this->assertTrue($eq);
        // dd($newList);
    }

